import React from 'react';

const Dashboard = () => {
    return (
        <box>
            <Navbar/>
            <Stack direction='row' spacing={2}>
                <Sidebar/>
                <Feed/>
                <Rightbar/>
            </Stack>
            <Add/>
        </box>
    );
};

export default Dashboard;
